  // const [promotion, setPromotion] = useState('q');
  const [show, setShow] = useState(true);

  return (
    <>
      <div>
        <Button show={show} onClick={() => setShow(true)}>
          Show Modal
        </Button>
      </div>
    </>
  );
}
